import React, { useRef, useEffect, useState, useCallback } from "react";
import ModalFormLoginError from "./ModalFormLoginError";
import {
  IconButton,
  InputAdornment,
  Grid,
  DialogContent,
  Paper,
  TextField,
  Button,
} from "@material-ui/core";
import VisibilityOffIcon from "@material-ui/icons/VisibilityOff";
import VisibilityIcon from "@material-ui/icons/Visibility";
import { ItextfIeldSignup } from "./appFolder-Interfaces";
import * as CSS from "csstype";

function TextFieldSignupx({
  updateSignvalues,
  rawSignupValues,
  signupShowPassword,
  ShowSignupPasswordForaWhile,
  size,
  passwordType,
  emailType,
}: ItextfIeldSignup): JSX.Element {
  var PcStyle: CSS.Properties = {};
  var MobileStyle: CSS.Properties = {};
  var WidthHolder = "";
  var TextFieldStyle: CSS.Properties = {};

  PcStyle = {
    width: WidthHolder,
    paddingBottom: "50px",
  };

  MobileStyleU = {
    transform: "scale(0.93)",
    width: "100%",
    paddingBottom: "45px",
  };
  MobileStyleP = {
    transform: "scale(0.93)",
    width: "99%",
    paddingBottom: "65px",
  };

  switch (size) {
    case "small":
      TextFieldStyle = MobileStyle;
      break;
    default:
      TextFieldStyle = PcStyle;
  }
  return (
    <>
      {emailType ? (
        <TextField
          size={size}
          style={TextFieldStyleU}
          label="Email"
          type="email"
          onChange={updateSignvalues}
          name="inputedEmail"
          value={rawSignupValues.inputedEmail}
          variant="standard"
        />
      ) : passwordType ? (
        <TextField
          size={size}
          style={{}}
          label="Password"
          type={signupShowPassword ? "text" : "password"}
          onChange={updateSignvalues}
          name="inputedPassword"
          value={rawSignupValues.inputedPassword}
          variant="standard"
          InputProps={{
            endAdornment: (
              <InputAdornment position="end">
                <IconButton
                  onClick={ShowSignupPasswordForaWhile}
                  onMouseDown={ShowSignupPasswordForaWhile}
                  aria-label="toggle password visibility"
                >
                  {signupShowPassword ? (
                    <VisibilityIcon />
                  ) : (
                    <VisibilityOffIcon />
                  )}
                </IconButton>
              </InputAdornment>
            ),
          }}
        />
      ) : (
        <TextField
          size={size}
          style={{
            transform: "scale(0.93)",
            width: "99%",
            paddingBottom: "65px",
          }}
          label="Username"
          type="text"
          onChange={updateSignvalues}
          name="inputedUsername"
          value={rawSignupValues.inputedUsername}
          variant="standard"
        />
      )}
    </>
  );
}

export const TextFieldSignup = React.memo(TextFieldSignupx);
